import "./Main.css";
import Item from "./components/Item";
import ItemPage from "./components/ItemPage";
import axios, { Axios } from "axios";
import ReactDOM from "react-dom/client";
import React, { Children } from "react";
import Test from "./components/test";

const CreateItem = (ItemInfo) => {
  document.getElementById("MainP").appendChild(<Test></Test>);
};

// get relevant item list but for now just all items
// loop through those items and add them to the main page

function Main() {
  return (
    <div className="Parent">
      <button
        onClick={() => {
          document.getElementById("MainP").appendChild(<Test></Test>);
        }}
      >
        CLICK
      </button>
      <div className="Main" id="MainP"></div>
      <Test></Test>

      <ItemPage />
    </div>
  );
}

